abstract:
Herbicidal compounds of the general formula
wherein X is (-CR4R4-)m in which m is 0 or 1;
Y is (-CR5R6-)n in which n is 0,1 or 2;Z is (-CR7R7-)p in which p is 1, 2 or 3;the sum of m + n + p is an integer of from 2 to 5;R, is a hydrogen atom or a C1-6 alkyl group optionally substituted by up to 3 fluorine, chlorine and/or bromine atoms;R2 is a hydrogen atom or a C1-6 straight-chain alkyl group;R3 is a hydrogen atom; a C1-10 alkyl group; a cyano group; an alkyl group substituted by one or more halogen atoms or by a hydroxy group, a cyano group, a C1-6 alkoxy group, an aryloxy group, a C1-6 alkylsulphonyl group, an arylsulphonyl group, an aralkylsulphonyl group, an azido group, a C1-6 alkoxycarbonyl group, an aralkoxycarbonyl group, a hydroxycarbonyl group, a phosphoryl group, a phosphoryloxy group, or an amine oxide, carbamoyl or thiocarbamoyl group in which each nitrogen is substituted by hydrogen or by 1 or 2 C1-4 alkyl groups; a C2-4 alkenyl or alkynyl group; an aryl or aralkyl group, each containing from 6 to 11 carbon atoms including 1 to 4 carbon atoms in the alkyl portion and optionally ring substituted by one or more fluorine, chlorine and/or bromine atoms or by a C1-2 alkyl or alkoxy group, each optionally substituted by one or more fluorine and/or chlorine atoms; a group -CSNH2: a group -CO2R8 or -CON(R8)2 in which R8 is a hydrogen atom or a C1-6 alkyl group; or a C1-6 acyl group or an oxime or an acetal derivative of said acyl group;each R4 is independently a hydrogen atom; an alkyl group optionally substituted by up to 3 halogen atoms; a hydroxy group; or a C1-4 alkoxy group; or one of R4 and R1 together form a carbon-carbon bond;R5 and R6 each independently is a hydrogen atom or a C1-2 alkyl group; or when located on a carbon atom adjacent to the ring oxygen atom then R5 and R6 together form an alkylene group containing 4 or 5 carbon atoms;each R7 independently is a hydrogen atom or a C1-4 alkyl group optionally substituted by up to 3 halogen atoms; or when n is 0 then R7 is also a chlorine or bromine atom, or two of R7 when located on adjacent carbon atoms togetherform an epoxide ring or a carbon-carbon bond; or when n is 1, then one R7 on the carbon adjacent to the carbon bearing R2 is a hydroxy group, a C7-11 aralkoxy group, or a C1-4 alkoxy group, and the other R7 is a hydrogen atom;both of Q are hydrogen atoms or fluorine atoms; and

